import React from "react";
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import Container from "@material-ui/core/Container";
import TextField from "@material-ui/core/TextField";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Divider from "@material-ui/core/Divider";
import Link from "@material-ui/core/Link";
import Paper from "@material-ui/core/Paper";
import Hidden from "@material-ui/core/Hidden";
import withWidth from "@material-ui/core/withWidth";
import Toolbar from "@material-ui/core/Toolbar";
import Box from "@material-ui/core/Box";
import Grid from "@material-ui/core/Grid";
import AppBar from "@material-ui/core/AppBar";
import LockOutlinedIcon from "@material-ui/icons/LockOutlined";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import { spacing } from "@material-ui/system";
import Drawer from "@material-ui/core/Drawer";
import ReactDOM from "react-dom";
import GoogleLogin from "react-google-login";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import MailIcon from "@material-ui/icons/Mail";

const drawerWidth = 210;

const useStyles = makeStyles(theme => ({
  root: {
    display: "flex"
  },
  image: {
    backgroundImage: "url(./logo.png)",
    backgroundRepeat: "no-repeat",
    backgroundSize: "contain",
    backgroundPosition: "center"
  },
  divider: {
    backgroundColor: theme.palette.primary.contrastText
  },
  miniBar: {
    top: "auto",
    bottom: 0,
    alignItems: "center"
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0
  },
  drawerPaper: {
    width: drawerWidth,
    backgroundColor: theme.palette.primary.main,
    color: theme.palette.primary.contrastText
  },
  toolbar: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.default,
    padding: theme.spacing(3)
  }
}));

function loginButtons() {
  const classes = useStyles();
  return (
    <List>
      <ListItem className={classes.toolbar}>
        <GoogleLogin
          clientId="472983817080-fdu8q9rhdr5bdnp8v68p0eaq4u7e6lgh.apps.googleusercontent.com"
          buttonText="Login with Google"
          onSuccess={responseGoogle}
          onFailure={responseGoogle}
          cookiePolicy={"single_host_origin"}
        />
      </ListItem>
    </List>
  );
}

const responseGoogle = response => {
  console.log(response);
  // first one
  // 1064855146728-dhtpjoavv0bohmus2aovdlvljk55ap42.apps.googleusercontent.com

  // second one
  // secret: 4m4EqqJqIoifGpKpoDGYDdCH
};

export default function SignInSide() {
  const classes = useStyles();

  return (
    <Layout menu={loginButtons()}>
      <Grid item xs={12} md={8}>
        <Box height="90vh" className={classes.image} />
      </Grid>
    </Layout>
  );
}
